import classes from "./Users.module.css";
const Users = function (props) {
  return (
    <div>
      <div className={classes.personal}>
        <li>props.name</li>
        <li>props.date</li>
        <li>props.sex</li>
        <li>props.Mobile</li>
        <li>props.GovtID</li>
      </div>
      <div className={classes.contact}>
        <li>props.GDetails</li>
        <li>props.email</li>
        <li>props.emergencyNumber</li>
        <li>props.Mobile</li>
        <li>props.GovtID</li>
      </div>
    </div>
  );
};
export default Users;
